import React, {Component} from 'react';
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";


class TestFull extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            range: [],
            models: [],

        }
        this.rangeId=1;


    }
    componentDidMount(){
        let combo=window.location.pathname.split('/');
        this.qq=combo[2]
        const res = fetch("http://127.0.0.1:8000/range/"+this.qq)
        .then (res => res.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    range: result,
                });
                // this.range=result;

            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
        const res2 = fetch("http://127.0.0.1:8000/range/"+this.rangeId+ "/models/")
        .then (res2 => res2.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    models: result,
                });
                // this.models=result;

            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
    }
    render() {
        const {error, isLoaded, range, models} = this.state;
        return (

            <div>
                <div className={"Prizivnik"}>{range.surname}</div>

                <div className={"models_list"}>

                {models.map(model=>(
                    <li key={"modelId:"+model.pk}>
                        <div className={"model_info"}>

                        <div className={"model_name"}>
                             <Link to={`/range/${this.qq}${model.pk}/`}>{model.pk}</Link>
                        </div>
                        <div className={"producer"}>Производитель: {model.vozrast}</div>
                        <div className={"price"}>Цена: {model.adress} руб.</div>

                        </div>
                    </li>
                ))}
                </div>

            </div>
        );
    }
}

export default TestFull;
